selector_to_html = {"a[href=\"#id4\"]": "<aside class=\"footnote brackets\" id=\"id4\" role=\"doc-footnote\">\n<span class=\"label\"><span class=\"fn-bracket\">[</span>4<span class=\"fn-bracket\">]</span></span>\n<p><a class=\"reference external\" href=\"https://www.inmodiario.com/191/28609/espana-entra-top-mundial-uso-blockchain-sector-inmobiliario.html\">Espa\u00f1a entra en el top-10 mundial en el uso del blockchain en el sector inmobiliario</a>.\n11 de febrero de 2020. Inmodiario.</p>\n</aside>", "a[href=\"#\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Sectores que se ven afectados por blockchain: sector inmobiliario<a class=\"headerlink\" href=\"#sectores-que-se-ven-afectados-por-blockchain-sector-inmobiliario\" title=\"Link to this heading\">#</a></h1><p>Como les cont\u00e9 en la <a class=\"reference internal\" href=\"../estamos-preparados-para-un-nuevo-tipo-de-monedas-completamente-digitales/\"><span class=\"doc\">publicaci\u00f3n anterior</span></a>,\nestoy en un curso de transformaci\u00f3n digital. Pues bueno, la idea es que\ncompartir\u00e9 algunas de mis participaciones en el curso y as\u00ed mantener activo el\nblog en este tiempo. El blockchain es un tema central en el inicio del curso,\ny esta vez les comentar\u00e9 algo breve sobre un sector de aplicaci\u00f3n: sector\ninmobiliario.</p><p>Podemos ver en general el gran impacto que tendr\u00e1 la tecnolog\u00eda blockchain en\ndiversos sectores para mejorar la trazabilidad de las transacciones, conservar\ninformaci\u00f3n protegida y la ejecuci\u00f3n de contratos inteligentes que eliminen la\nintermediaci\u00f3n. De hecho, como afirma Santiago M\u00e1rquez (CTO de Clluc) \u201ctodo\nsector que se encuentre intermediado es susceptible de ser transformado\u201d [<a class=\"reference internal\" href=\"#id1\">1</a>].</p>", "a[href=\"#id3\"]": "<aside class=\"footnote brackets\" id=\"id3\" role=\"doc-footnote\">\n<span class=\"label\"><span class=\"fn-bracket\">[</span>3<span class=\"fn-bracket\">]</span></span>\n<p><a class=\"reference external\" href=\"https://grupoeminmobiliaria.com/blockchainen-inmobiliaria-espana-top-10/\">Blockchain en el sector inmobiliario: Espa\u00f1a se encuentra dentro del top 10</a>.\nKaty Chamberlain Diaz. 18 de febrero de 2020. Grupo EM Inmobiliaria.</p>\n</aside>", "a[href=\"#sectores-que-se-ven-afectados-por-blockchain-sector-inmobiliario\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Sectores que se ven afectados por blockchain: sector inmobiliario<a class=\"headerlink\" href=\"#sectores-que-se-ven-afectados-por-blockchain-sector-inmobiliario\" title=\"Link to this heading\">#</a></h1><p>Como les cont\u00e9 en la <a class=\"reference internal\" href=\"../estamos-preparados-para-un-nuevo-tipo-de-monedas-completamente-digitales/\"><span class=\"doc\">publicaci\u00f3n anterior</span></a>,\nestoy en un curso de transformaci\u00f3n digital. Pues bueno, la idea es que\ncompartir\u00e9 algunas de mis participaciones en el curso y as\u00ed mantener activo el\nblog en este tiempo. El blockchain es un tema central en el inicio del curso,\ny esta vez les comentar\u00e9 algo breve sobre un sector de aplicaci\u00f3n: sector\ninmobiliario.</p><p>Podemos ver en general el gran impacto que tendr\u00e1 la tecnolog\u00eda blockchain en\ndiversos sectores para mejorar la trazabilidad de las transacciones, conservar\ninformaci\u00f3n protegida y la ejecuci\u00f3n de contratos inteligentes que eliminen la\nintermediaci\u00f3n. De hecho, como afirma Santiago M\u00e1rquez (CTO de Clluc) \u201ctodo\nsector que se encuentre intermediado es susceptible de ser transformado\u201d [<a class=\"reference internal\" href=\"#id1\">1</a>].</p>", "a[href=\"#id1\"]": "<aside class=\"footnote brackets\" id=\"id1\" role=\"doc-footnote\">\n<span class=\"label\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></span>\n<p><a class=\"reference external\" href=\"https://www.pisos.com/aldia/que-aporta-el-blockchain-al-sector-inmobiliario/1628532/\">\u00bfQu\u00e9 aporta el blockchain al sector inmobiliario?</a>.\nE. Esparza. Pisos.com. 9 de julio de 2018.</p>\n</aside>", "a[href=\"#id2\"]": "<aside class=\"footnote brackets\" id=\"id2\" role=\"doc-footnote\">\n<span class=\"label\"><span class=\"fn-bracket\">[</span>2<span class=\"fn-bracket\">]</span></span>\n<p><a class=\"reference external\" href=\"https://www.zonamovilidad.es/blockchain-sector-inmboliario-acuerdo-alastria-fibree\">La tecnolog\u00eda blockchain se abre hueco en el sector inmobiliario</a>.\nAlfonso de Casta\u00f1eda. Zona Movilidad. 3 de febrero de 2020.</p>\n</aside>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
